import React, { useEffect, useState } from "react";

export default function ListeStations({ url, setStationsData }) {
  useEffect(() => {
    const fetchStations = () => {
      fetch(url)
        .then((response) => response.json())
        //.then((data) => console.log(data.result.stations))
        .then((data) => setStationsData(data.result.stations))
        .catch((e) => console.log("ERREUR : " + e));
    };
    fetchStations();
  }, [setStationsData]);

  return <div></div>;
}
